import React, { ReactElement } from 'react';

import catalogIcon from '@/assets/images/menu/catalog.svg';
import processLogo from '@/assets/images/menu/processes.svg';
import incidentsLogo from '@/assets/images/menu/incidents.svg';
import { NavLink } from '@/components/common';
import './styles.scss';
import { StandartTitle } from '../standart-title';

interface IProps {
  title: string;
  text: string;
  icon: string;
}

function Card({ title, text, icon }: IProps): ReactElement {
  return (
    <div className='card'>
      <div className='card_header'>
        <StandartTitle text={title} />
        <div className='card_btn-container'>
          <div className='card_btn'>
            <span>
              <img src={icon} alt={title} />
            </span>
          </div>
        </div>
      </div>
      <p className='card_text'>{text}</p>
    </div>
  );
}

export default Card;
